svg.script:
 

var Clock={
 sec : 0,
 
 
  start: function(){
  var self = this;
   function pad ( val ) { return val > 9 ? val : "0" + val; }
    this.interval = setInterval( function(){
        document.getElementById("seconds").innerHTML=pad(++self.sec%60);
        document.getElementById("minutes").innerHTML=pad(parseInt(self.sec/60,10));
        document.getElementById("hours").innerHTML=pad(parseInt(self.sec / 3600, 10));
    }, 1000);
    },
    
    reset: function(){
    
    Clock.sec=null;
    clearInterval(this.interval);
    document.getElementById("seconds").innerHTML="00";
    document.getElementById("minutes").innerHTML="00";
    document.getElementById("hours").innerHTML="00";
    },
    pause: function(){
    clearInterval(this.interval);
    delete this.interval;
    },
    restart: function(){
    this.reset();
    Clock.start();
    },
    
 };
